import React from 'react';
import './Gift.css'
import GiftImage from './Images/gift.svg';

const Gift = () => {
    return (<>
        <main>
            <div className="container-fluid d-flex justify-content-center align-items-center flex-column" id="GiftMain">
                <img src={GiftImage} alt="Gift" className="mb-5" />
                <h4 className="text-center">Send Gold to your loved ones online in just a few clicks</h4>
                <button className="btn mt-3">Send your first gift <i className="fas fa-arrow-right ml-1"></i></button>
            </div>
        </main>
    </>);
}

export default Gift;
